import './App.css';
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom';
import Products from './products/pages/ProductsApp';

const App = () => {
  return (
    <Router>
      <Routes>
          <Route path='/'>
            <Products />      
          </Route>
      </Routes>
    </Router>
  );
};

export default App;
